// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

// components
import SignIn from "../users/signIn/SignIn";
import SignUp from "../users/signUp/SignUp";
import HeaderUser from "./HeaderUser";

// =================================================================
const useStyles = createUseStyles({
  Header: {
    padding: "2rem 10rem",
    fontSize: "1.6rem",
    backgroundColor: " #1d1d26",
    zIndex: "10",
  },
  header__logo: {
    textTransform: "uppercase",
    fontSize: "3rem",
    fontWeight: "700",
  },
});

export default function Header({ user }) {
  const classes = useStyles();

  return (
    <div
      className={
        classes.Header +
        ` position-fixed w-100 t-0 d-flex align-items-center justify-content-between `
      }
    >
      <a className={classes.header__logo} href="http://">
        <ion-icon name="dice"></ion-icon>
        <div className={classes.header__logo_}></div>
      </a>
      {user.email === "" ? (
        <div className="header__buttons btns--flex">
          <Link to="users/signIn">
            <button className="button btn--none-border btn--hover-bb mb-0">
              Sign in
            </button>
          </Link>
          <Link to="users/signUp">
            <button className="button btn--border btn--hover-border mb-0">
              Sign up
            </button>
          </Link>
        </div>
      ) : (
        <HeaderUser user={user} />
      )}
    </div>
  );
}
